import CommandInitializer from "@components/CommandInitializer";
import { Component } from "solid-js";
import { diffWords } from "diff";
import RenderDiff from "@components/RenderDiff";

// MOCK data
const staff_db = {
	mal_id: 1,
	name: "Tomokazu Seki",
	given_name: "\u667a\u4e00",
	family_name: "\u95a2",
	alternate_name: ["Seki Mondoya", "\u9580\u6238 \u958b", "Monto Hiraku"],
	about: "Hometown: Tokyo, India\nBlood type: O+\nTwitter: @seki0908\nInstagram: @sekitomokazu\nProfile: Sheldon Monkey",
	staff_image: {
		image: "",
		mimetype: "jpg"
	}
};

const staff_mal = {
	mal_id: 1,
	name: "Tomokazu Seki Sora",
	given_name: "\u667a\u4e00",
	family_name: "\u95a2",
	alternate_name: ["Sora Mondoya", "\u9580\u6238 \u958b", "Monto Hiraku", "Sheldon"],
	about: "Hometown: Tokyo, Japan\nBlood type: AB\nTwitter: @seki0908\nInstagram: @sekitomokazu\nProfile: Atomic Monkey\nBe cool.",
	staff_image: {
		image: "",
		mimetype: "jpg"
	}
};

const Staff: Component = () => {
	const handleFetchEvent = (e: CustomEvent<string>) => {
		console.log(e.detail);
	};

	const diff = {
		name: diffWords(staff_db.name, staff_mal.name),
		given_name: diffWords(staff_db.given_name, staff_mal.given_name),
		family_name: diffWords(staff_db.family_name, staff_mal.family_name),
		alternate_name: diffWords(
			staff_db.alternate_name.join(", "),
			staff_mal.alternate_name.join(", ")
		),
		about: diffWords(staff_db.about, staff_mal.about)
	};

	return (
		<div class="flex h-full flex-1 flex-col gap-2">
			<CommandInitializer onFetchClick={handleFetchEvent} title={"Staffs"} />
			<div class="overflow-x-hidden overflow-y-scroll">
				<div class="grid w-full grid-cols-[1fr_1fr] gap-2">
					<div class="flex select-text gap-2 overflow-x-scroll rounded bg-neutral/25 p-2">
						<img
							class="h-20 rounded"
							src={`data:image/${staff_db.staff_image.mimetype};base64,${staff_db.staff_image.image}`}
						/>
						<div class="flex flex-col gap-1">
							<RenderDiff diff={diff.name} options={{ type: "remove" }} />
							<RenderDiff diff={diff.given_name} options={{ type: "remove" }} />
							<span class="flex flex-col text-sm">
								Alternate names:
								<RenderDiff
									diff={diff.alternate_name}
									options={{ type: "remove" }}
								/>
							</span>
							<span class="flex flex-col text-sm">
								Family name:
								<RenderDiff diff={diff.family_name} options={{ type: "remove" }} />
							</span>
							<p class="mt-2 text-sm">
								<RenderDiff diff={diff.about} options={{ type: "remove" }} />
							</p>
						</div>
					</div>
					<div class="flex select-text gap-2 overflow-x-scroll rounded bg-neutral/25 p-2">
						<img
							class="h-20 rounded"
							src={`data:image/${staff_mal.staff_image.mimetype};base64,${staff_mal.staff_image.image}`}
						/>
						<div class="flex flex-col gap-1">
							<RenderDiff diff={diff.name} options={{ type: "add" }} />
							<RenderDiff diff={diff.given_name} options={{ type: "add" }} />
							<span class="flex flex-col text-sm">
								Alternate names:
								<RenderDiff diff={diff.alternate_name} options={{ type: "add" }} />
							</span>
							<span class="flex flex-col text-sm">
								Family name:
								<RenderDiff diff={diff.family_name} options={{ type: "add" }} />
							</span>
							<p class="mt-2 text-sm">
								<RenderDiff diff={diff.about} options={{ type: "add" }} />
							</p>
						</div>
					</div>
				</div>
			</div>
		</div>
	);
};

export default Staff;
